    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN col2 AND col0 * + col2 * col0;
  - name: tab1

outputs:
  - name: q3285.out
    data: |
      85	5	59
      91	47	68
